import { Link, useHistory } from "react-router-dom";
import {CategoryItem} from '../components/CategoryItem'

const {goBack} = useHistory();

function CategoryList({catalog = []}){
    return (
        <div className="list">
            {catalog.map(el => (
                <CategoryItem key={el.idCategory} {...el} />
            ))}
        </div>
    )
}

export {CategoryList}
